    false,nt"url": null,nt"notes": "This annual narrative report for Cape Newenham
    NWR (now part of Togiak NWR) outlines Refuge accomplishments during the 1970 calendar
    year. The report begins by summarizing the weather conditions and habitat conditions
    during the year. Wildlife- including migratory birds, upland game birds, furbearers,
    predators, rodents, mammals, raptors, and fish- is also covered. The Refuge development
    and maintenance section discusses physical developments and collections and receipts.
    A progress report on field investigations and applied research is also provided.
    The public relations section of the report describes Refuge visitors. Photographs
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
